// src/components/Dashboard.js
import React, { useState, useEffect } from 'react';
import { toast } from 'react-toastify';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5005/api';

const Dashboard = () => {
  const [clientId, setClientId] = useState(localStorage.getItem('clientId') || '');
  const [loading, setLoading] = useState(false);
  const [oxCodes, setOxCodes] = useState([]);
  const [latestOxCode, setLatestOxCode] = useState('');

  useEffect(() => {
    fetchOxCodes();
  }, []);

  const fetchOxCodes = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`${API_URL}/ox-codes`, { withCredentials: true });

      if (response.data && Array.isArray(response.data)) {
        setOxCodes(response.data);

        // Find the latest OX code for this client
        const clientCodes = response.data.filter(code => code.client_id === clientId);
        if (clientCodes.length > 0) {
          setLatestOxCode(clientCodes[0].ox_code);
        }
      }
    } catch (error) {
      console.error('Error fetching OX codes:', error);
      // Gracefully handle error but don't show toast to avoid confusion
      // Only show OX codes that are available for this client
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="row">
      <div className="col-md-12">
        <div className="card">
          <div className="card-header bg-success text-white">
            <h4>Dashboard</h4>
          </div>
          <div className="card-body">
            <div className="alert alert-success">
              <h5>Successfully Authenticated!</h5>
              <p>Welcome, Client ID: {clientId}</p>
              {latestOxCode && (
                <div>
                  <p>Your latest OX Code: <strong>{latestOxCode}</strong></p>
                  <p>This code has been securely stored in our database with a timestamp.</p>
                </div>
              )}
            </div>

            <div className="row mt-4">
              <div className="col-md-12">
                <h5>Authentication History</h5>
                {loading ? (
                  <div className="text-center">
                    <div className="spinner-border text-primary" role="status">
                      <span className="visually-hidden">Loading...</span>
                    </div>
                  </div>
                ) : (
                  <div className="table-responsive">
                    <table className="table table-striped table-hover">
                      <thead>
                        <tr>
                          <th>Date & Time</th>
                          <th>OX Code</th>
                        </tr>
                      </thead>
                      <tbody>
                        {oxCodes.filter(code => code.client_id === clientId).map((code, index) => (
                          <tr key={code.id || index}>
                            <td>{code.timestamp}</td>
                            <td>{code.ox_code}</td>
                          </tr>
                        ))}
                        {oxCodes.filter(code => code.client_id === clientId).length === 0 && (
                          <tr>
                            <td colSpan="2" className="text-center">No authentication history found</td>
                          </tr>
                        )}
                      </tbody>
                    </table>
                  </div>
                )}
              </div>
            </div>

            <div className="alert alert-info mt-4">
              <h5>Application Information</h5>
              <p>
                This secure client portal allows you to authenticate with Motilal Oswal's
                Open API. Your OX codes are securely stored and can be used for API access.
              </p>
              <p>
                For any issues or support, please contact your account manager.
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
